import Contact from "./Contact";

const App = () => {
  return (
    <>
      <div className=".container">
        <h3>Contact List:</h3>
      </div>
      <div className="contact">
        <Contact name="Rajan" num="9825674877" addr="Nepal" />
        <Contact name="Mahesh" num="987235663" addr="Japan" />
        <Contact name="Rajan" num="9825674877" addr="Nepal" />

      </div>
    </>
  );
};

export default App;
